// westwood.js v0.1
"use strict";

var westwoodscroll = (function () {
  var mp3 = {
    prefix: "data:audio/mp3;base64,",
    sound: [
	    "",
      "",
      "",
      "",
      "",
      "",
      "",
      "",
      "",
      "",
      "",
      "",
      ""
	  ]
  };

  return function (trigger_distance) {
    trigger_distance = trigger_distance || 400;
    var lastOffset;

    var westwoodHandler = function() {
      var scrollOffset = Math.floor(window.scrollY / trigger_distance);
      if (lastOffset !== scrollOffset) {
        playAudio();
        lastOffset = scrollOffset;
      }
    };

	window.addEventListener('scroll', westwoodHandler, false)
  };

  function playAudio(position){
    var player = getPlayer()
      , rand = Math.floor(Math.random() * mp3.sound.length);

    player.src = mp3.prefix + mp3.sound[position || rand];
    player.play();
  };

  function getPlayer() {
    var container = getContainer(), player
      , players = container.getElementsByTagName("audio");

    for (player in  players) {
      if (player.currentTime === 0 || player.ended) {
        return player;
      }
    }

    player = document.createElement("audio");
    container.appendChild(player);
    return player;
  };

  function getContainer() {
    var container = document.getElementById("westwoodscroll");

    if (container === null) {
      container = document.createElement("div");
      container.id = "westwoodscroll";
      document.getElementsByTagName('body')[0].appendChild(container);
    }

    return container;
  }
})();
